import React from "react";
import Common from "./Common";
import web from "../src/Images/business.jpg";


const About = () => {
  return (
   <Common name='Three years of experience in  '
     imgsrc={web}
     visit="/contact"
     btnname="Contact Now"
   />
  );
};
export default About;
